'use strict';
let MessageType = require('./MessageType.js');
let OffersList = require('./OffersList.js');
class GetOffersMessage {
    offersList;
    requestId;
    constructor() {
        this.offersList = new OffersList();
    }
    getOffers() {
        return this.offersList.toArray();
    }
    getType() {
        return MessageType.GetOffers;
    }
    getRequestId() {
        return this.requestId;
    }
}
module.exports = GetOffersMessage
